import React from 'react';
import List from './List';

function App() {
  return (
    <>
      <list
        imgsrc="https://picsum.photos/id/237/200/300"
        title="First"
        sname="Dark"
        link="https://www.netflix.com/in/"
      />
    </>
  );
}

export default App;
